import './Footer.css';
// import {FOOTER_company, FOOTER_customerCare, FOOTER_account, FOOTER_socials, FOOTER_payment} from '../../const.js';
import LogoWhite from '../../images/CC-UIE-white-logo.png';
import { FooterInfo } from '../../const.js'
// import { FooterInfo } from '../../const.js'

function Footer() {
    return (
        <div id="Footer" className='bg-black py-4 px-3 flex-direction-column'>
            <div id='mainFooter' className='img-resp flex centercenter'>
                <div className='pr-2 ft-logo basis30'>
                    <img src={LogoWhite} className='img-resp' />
                </div>

                <div className='pr-2 text-white flex-direction-column basis40'>
                    <p>{FooterInfo[0].address1}</p>
                    <p>{FooterInfo[0].address2}</p>
                    <p>{FooterInfo[0].phoneNumber}</p>
                </div>

                <div className='text-white basis30'>
                    <p>Center Centre is proud to provide you the expertise you need to
                    deliver better products and services.
                    </p>
                </div>

            </div>

            <div id='subFooter' className='border-top flex-space-between text-white pt-2'>
                <span>Copyright {FooterInfo[1].year} Center Centre Inc. All rights reserved.</span>
                <span>Questions or comments? <a href={FooterInfo[1].contactUs}>Contact us.</a></span>
                <span><a href={FooterInfo[1].privacyNotice} className='footerLink'>Privacy Notice</a></span>





            </div>


        </div>
    );
}

export default Footer
